import React, { Component } from "react";

import {
    Navbar,
    NavItem,
    Icon,
    SideNav,
    SideNavItem,
    Button
} from "react-materialize";
import SideMenu from "./SideMenu";

import M from "materialize-css";

class Nav extends Component {

    render() {
        return (
            <div>
                <Navbar
                    className="light-blue lighten-1"
                    alignLinks='right'

                    brand={
                        <SideMenu/> 
                    }
                    menuIcon ={<Icon>menu</Icon>}
                    // menuIcon={<SideMenu/>}
                    options={{
                        draggable: true,
                        edge: "left",
                        inDuration: 250,
                        onCloseEnd: null,
                        onCloseStart: null,
                        onOpenEnd: null,
                        onOpenStart: null,
                        outDuration: 200,
                        preventScrolling: true
                    }}
                >

                    <NavItem className="left" href="#">Book Me In</NavItem>
                </Navbar>

            </div>
        );
    }
}

export default Nav;
